import React, { useState } from 'react';
import './App.css';

function App() {
  const [number, setNumber] = useState(5)
  const changeNumber = () => {
    setNumber(10)
  }
  return (
    <div className="App">
      Number is: {number}
      <button onClick={changeNumber}>change me</button>
    </div>
  );
}

export default App;
